import React from 'react';
import NavBar from './Navbar';
import MastHead from './Masthead';
import PortFolio from './Portfolio';
import Footer from './footer';


const App=()=>{
    return(
        <div>
        

            <NavBar/>
            <MastHead/>
            <PortFolio/>
            <Footer/>

        </div>
    )
};

export default App;
